      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "16. Bey hrn. Rudolf Ramsperger an der huthgasse ist extra guter holländer-Taback in bleyernen Pfund-Büchsen à 10 Basen, wie auch guter St. Vincent à 3 Rth. zu haben."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "17. Wo guter Art grosse Bohnen zum Setzen, und kleine weisse dito zum Kochen in billigem Preis zu haben, ist im Berichtshause ohne Entgeld zu erfragen."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "18. Zwey Baretlein oder Professor-Hüth, wie auch ein ganz neuer Castor-Huth, mittelmässiger Grösse, im Berichtshause zu erfragen."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "19. Bey hrn. Burchardt zum Riesen sind extra neue grosse Italiänische Feigen, dito grosse Meertrauben mit und ohne Stiel, haselnuss, dürre Morcheln, feiner Chocoladen, alles in billigem Preis zu haben."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "20. Zwölf Sack neuer Waisen in billigem Preis, im Berichtshause ohne Entgeld zu erfragen."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "21. Bey hrn. Jacob Grimm Buchbinder ist zu haben: Ein Kriegs-Atlas von 63 theils Landkarten, Städten, Plans von Bataillen und Belagerungen des jetzigen Kriegs. 2) Die Welt in einer Nuss mit Kupfern. 3) Die durchlauchtige Welt, 4 Theil mit Waapen. 4) Journal du Camp de Compiegne avec figures."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "22. Zwey saubere französische Bether in ein Wirthshaus auf das Land oder in ein Bad dienlich, ohnentgeldlich im Berichtthauss zu erfragen."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "23. Eine Behausung in der Reschmer Vorstadt mit 4 Stuben, 5 Kammern samt einer grossen Werkstatt, Essig und einem schönen gewölbten Keller und Garten, weshalb sich bey hrn. Jacob Mäglin dem Weinmann anzumelden."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "24. Ein Freund, welcher circa 600 Sester hanf. Saamen anhero liefern könnte, möchte aber solchen vorhero verkauft wissen, offeriert selbigen daher in billigem Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "25. Wo guter alter weisser Wein zu haben, ist bey Mstr. Michael Fuchs dem Küeser zu der nehmen."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "26. Circa 6. Saum extra guter alter pur rother Pösteiner-Wein, so gut als Neuenburger oder Burgunder, in billigem Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "27. Zwey Stücklein weissen Wein von 1756, 8 Pfund 10 ß der Saum im einten, und 8 Pfund im andern, wovon nach Belieben zu haben, im Berichtshause ohne Entgeld zu erfragen."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "28. Ein Stock heu ab 3 Thänen Matten vorm Riechemer-Thor oberhalb der Schorenbrück. Ferner ein Stücklein von 7 Saumen rothes Bölliger-Wein von 1760. schön roth und lauter, im Berichtshause ohne Entgeldt zu erfragen."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "29. Auf E. E. Zunft zum Bären sind wiederum neue Saure Rüben in billigem Preis zu haben."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "30. Ein roth Scharlachen Camisol und Hosen in billigem Preis, im Berichtshause zu erfragen."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "31. Im Offenburger-Hof ist wohlverwährter Bau zu haben."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "32. Ein Brennhäuslein bey der Steinen-Mühlin mit aller Kommlichkeit, im Berichtshause ohne Entgeldt zu erfragen."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "33. Bey weme rother und weisser Burgunder, wie auch Muscat-Wein, Piecenweiss wegen Mangel Plätzen, wie auch roth und weisser 1753ger Margräser-Wein in billigem Preis zu haben, ist im Berichtshause ohne Entgeldt zu erfragen."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "34. Feine heitergelbe hamburger Strick-Wollen das Pfund à 6 Pfund, wo dieselbe Pfundweis zu haben, ist im Berichtshause ohne Entgeldt zu erfragen."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "35. Hrn. hofzach des Stegriss Behausung im Spieg-Häslein mit 4 Stuben, 3 Kammern zc. ist entweder zu verkaufen, oder samethaft zu verlehen."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "36. Weisse und rothe Margräser-Weine von 1760. wovon in billigem Preis nach Belieben zu haben, im Berichtshause zu erfragen."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "37. Ein Mannensitz in St. Peters Kirch auf dem Leitner. Item ein grün Tombau-Bethlein mit grünen wollenen Umhängen, in billigem Preis, im Berichtshause zu erfragen."
    },
    {
      "date": "1760-01-03",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "38. Ein Hausschlitten mit einem schönen Bild und Zugehördt in billigem Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1760-01-03",
